import React from "react";

const Genres = ({ allGenres }) => {
  console.log(allGenres)
  return (
    <select defaultValue="select">
      {allGenres?.map((option) => (
        <option key={option.id} value={option.name}>
          {option.name}
        </option>
      ))}
    </select>
  );
};

export default Genres;
